template<typename Scalar>
static void run()
{
    Eigen::SparseMatrix<Scalar> A{3969, 3969};
    std::vector<Eigen::Triplet<Scalar>> triplets{};
    triplets.reserve(3969);

    for (int i = 0; i < 51597; i++) {
        triplets.emplace_back(A_rows[i], A_cols[i], A_values[i]);
    }
    A.setFromTriplets(triplets.begin(), triplets.end());

    Eigen::Matrix<Scalar, Eigen::Dynamic, 1> b{3969};
    for (int i = 0; i < 3969; i++) {
        b(i) = static_cast<Scalar>(b_data[i]);
    }

    auto result = *Eigen::expm_multiply(A, b);
    for (int i = 0; i < 3969; i++) {
        Scalar target = static_cast<Scalar>(res_data[i]);
        if (res_data[i] == 0) {
            ASSERT_NEAR(result(i), 0, 1e-6);
        }
        else {
            ASSERT_NEAR(result(i), target, std::max(1e-3 * std::abs(target), 1e-8));
        }

        if (result(i) == 0) {
            ASSERT_NEAR(target, 0, 1e-6);
        }
        else {
            ASSERT_NEAR(result(i), target, std::max(1e-3 * std::abs(result(i)), 1e-8));
        }
    }
}

TEST(expm_multiply, big_sparse_test_5_double) {
    run<double>();
}

TEST(expm_multiply, big_sparse_test_5_float) {
    run<float>();
}
